	add("zonk", "{\"term\":\"zonk\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"1960s. {{unk.|lang\u003den}} origin, likely imitative.Category:English onomatopoeias\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unfavorable card or token, or undesirable or worthless item used as a prize in a contest or game show (such as w:Let\u0027s Make a \u0027Let\u0027s Make a Deal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003-10-1, Gregory Arthur Baer \u0027Life: The Odds (And How to Improve Them)\u0027, Penguin, ISBN 1592400337, page [http://books.google.com/books?id\u003dQkTmVDKElq4C\u0026amp;pg\u003dPA237\u0026amp;dq\u003d%22a+zonk%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dAPvrT_T1K4S7rQHn4cHnBQ\u0026amp;ved\u003d0CEgQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22a%20zonk%22\u0026amp;f\u003dfalse 237\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"There will always be two doors that hold \u0027\u0027zonks\u0027\u0027, so regardless of whether you initially chose the grand prize or a \u0027\u0027zonk\u0027\u0027, Monty will always be able to show you a \u0027\u0027zonk\u0027\u0027 not chosen\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2003-12-30, Jerrilyn Farmer, \u0027Mumbo Gumbo: A Madeline Bean Novel\u0027, HarperCollins, ISBN 0380817195, page 204\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A live, mane-embellished, SAG-card-carrying lion, I should point out, who was likely being staged for a few minutes off to the side before he would be used as a freaking “\u0027\u0027Zonk\u0027\u0027!” on a freaking game show, for crying out loud\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2004, Jay Mechling, \u0027On My Honor: Boy Scouts and the Making of American Youth\u0027, University of Chicago Press, ISBN 0226517055, page [http://books.google.com/books?id\u003du8aSN5GSxZIC\u0026amp;pg\u003dPA124\u0026amp;dq\u003d%22a+zonk%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dAPvrT_T1K4S7rQHn4cHnBQ\u0026amp;ved\u003d0CDcQ6AEwA\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22a%20zonk%22\u0026amp;f\u003dfalse 124\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027zonk\u0027\u0027 was way overdue, yet the boys knew that the Seniors knew they would think this was a \u0027\u0027zonk\u0027\u0027 and would trick the boys by making this another real prize\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2004, Timothy V. Rasinski, Nancy Padak, \u0027Effective reading strategies: teaching children who find reading difficult\u0027, Pearson/Prentice Hall, ISBN 0131121863, page 15\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I have three empty coffee cans, two with prizes and one with a slip of paper that says \u0026quot;\u0027\u0027Zonk\u0027\u0027.\u0026quot\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2006-05-09, Bruce Frey, \u0027Statistics hacks\u0027, O\u0027Reilly Media, ISBN 0596101643, page 208\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Avoid the \u0027\u0027Zonk\u0027\u0027 / On the TV show Let\u0027s Make a Deal, contestants often had to choose between three curtains\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2008, Max H. Bazerman, Don A. Moore, \u0027Judgment in Managerial Decision Making\u0027, John Wiley \u0026amp; Sons, ISBN 0470049456, page 53\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Once a contestant picked a door, Monty would often open one of the other two doors to reveal a \u0027\u0027zonk\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2009, Victor Shoup, \u0027A Computational Introduction to Number Theory and Algebra\u0027, Cambridge University Press, ISBN 0521516447, page 217\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Behind two doors is a “\u0027\u0027zonk\u0027\u0027,” that is, something amusing but of little or no value, such as a goat\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A feeling of a drug taking hold.\u0026lt;!-- Awaiting attestation on this\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A cigarette hand-rolled from tobacco and cannabis. --\u0026gt\", \"priority\":19}]}, \"synonyms\":{}}");

	add("zony", "{\"term\":\"zony\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|zebra|pony|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The offspring of a male zebra and a female pony.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027 April 6, \u0026quot;vicki blakslee\u0026quot; (username), \u0026quot;Zonis zorses and zebras\u0026quot;, in \u0026lt;tt\u0026gt;rec.equestrian\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"amp;gt; Please tell us how you are doing. What do you have, \u0027\u0027zony\u0027\u0027 or zorse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027 June 27, \u0026quot;Bill Ramsay\u0026quot; (username), \u0026quot;Evolution\u0026quot;, in \u0026lt;tt\u0026gt;nz.soc.religion\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the old man with the beard decided to lay his hands upon this poor lonely pony, and descended upon her a bounty, a bounty so exceedingly large, that she was blessed with a \u0027\u0027zony\u0027\u0027 or a pebra, and this doth maketh lots of dosh for the \u0027\u0027zony\u0027\u0027’s owner, so that he too can be bountious with the hay from the tv rights, and dost ensure the continuing success of the little darling who shall dwell in the house of hay for evermore\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Marie Lestelle Evrard, \u0027You Look Sort of Strange\u0027, page v\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I am a \u0027\u0027zony\u0027\u0027. My father is a zebra and my mother is a pony\", \"priority\":7}]}, \"synonyms\":{}}");

